Forex portal - a universal application for trading

The application provides a wide range of functions necessary in the daily activities of any trader, namely:

1. Interactive graphs that update information in real time, with the ability to zoom and scroll;
2. News feed based on your interests - choose the categories that are of interest to you;
3. Training course - dive into this area with us. The lessons are written in English, with the help of them you will learn about the basics of trading, get acquainted with the basic concepts and rules of earnings in the foreign exchange market;
4. Indicators are a function that allow you to predict the future value of an asset;
5. Profit Calculator - using this tool, you can adjust the size of your trade to increase or decrease the potential profit or loss according to your trading plan;
6. Calculator of complex percentages - helps to calculate how much you can earn from a transaction;
7. Exchange rates and currency pairs.

Use our app for operational market analysis and for making successful deals!

